import { Card } from 'react-bootstrap';
import "./Home.css";
import { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function Home() {
  const [locations, setlocations] = useState([]);

  useEffect(() => {
    fetch('/data/getMenu')
      .then((res) => res.json())
      .then((data) => {
        const locs = data.map((el) => {
          return el.Location
        })
        setlocations(locs)
      });
  }, [])

  return (
    <div className="mobile-width-section">
      <Card style={{ width: '18rem' }}>
        <Card.Img variant="top" src="holder.js/100px180" />
        <Card.Body>
          <Card.Text className="text-end fs-1">
            Title
          </Card.Text>
        </Card.Body>
      </Card>
    </div>
  );
}

export default Home;
